import React from 'react';

export default (props:any) => {
    return (
        <div style={{
            width: '300px',
            margin: '0 auto',
            textAlign: 'center',
        }}>
            <h3>{ props.value }</h3>
            <button onClick={props.addValue}>Плюс 1</button>
            <button onClick={props.subValue}>Минус 1</button>
            <button onClick={props.resetValue}>Сбросить</button>
        </div>
    )
}

class ReduxComponent extends React.Component {
    state = {
        value: 0
    }
    render() {
        return (
            <div style={{
                width: '300px',
                margin: '0 auto',
                textAlign: 'center',
            }}>
                <h3>{ props.value }</h3>
                <button onClick={props.addValue}>Плюс 1</button>
                <button onClick={props.subValue}>Минус 1</button>
                <button onClick={props.resetValue}>Сбросить</button>
            </div> 
        )
    }
}
